import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLinkedin } from '@fortawesome/free-brands-svg-icons';
import { faInstagram } from '@fortawesome/free-brands-svg-icons';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { faFacebook } from '@fortawesome/free-brands-svg-icons';

const Output = () => {
  const footer = {
    color: 'red',
  };

  const foot = {
    textAlign: 'center',
  };
  const items = {
    margin:'1%',
    color:'green'
  };

  return (
    <div style={foot}>
      <h3>Designed and Developed by</h3>
      <h2 style={footer}> Abishek &hearts;</h2>
      <div >
      <a href=""><FontAwesomeIcon style={items} icon={faLinkedin} /></a>
      <FontAwesomeIcon style={items} icon={faInstagram} />
      <FontAwesomeIcon style={items} icon={faGithub} />
      <FontAwesomeIcon style={items} icon={faFacebook} />

      </div>
      
    </div>
  );
};

export default Output;
